ormat\'];\n }\n }\n\n if (!$result[$prefix . \'zone\'] && $result[$prefix . \'zone_id\']) {\n $zone_info = $this->model_localisation_zone->getZone($result[$prefix . \'zone_id\']);\n if ($zone_info) {\n $result[$prefix . \'zone\'] = $zone_info[\'name\'];\n }\n }\n\n $result[$prefix . \'custom_field\'] = $this->getProperty($array, $i_address . \'custom_field\', array());\n \n return $result;\n }\n\n private function registerAccount() {\n $redirect = \'\';\n\n $data = $this->getAddressData($this->request->post, \'payment_\');\n\n $data = array_merge($data, array(\n \'firstname\' => $this->getProperty($this->request->post, \'firstname\'),\n \'lastname\' => $this->getProperty($this->request->post, \'lastname\'),\n \'customer_group_id\'=> $this->getProperty($this->request->post, \'customer_group_id\', $this->config->get(\'config_customer_group_id\')),\n \'custom_field\' => array(\n \'account\' => $this->getProperty($this->request->post, \'custom_field\'),\n \'address\' => $this->getProperty($this->request->post, \'payment_custom_field\'),\n ),\n \'email\' => $this->getProperty($this->request->post, \'email\'),\n \'telephone\' => $this->getProperty($this->request->post, \'telephone\'),\n \'fax\' => $this->getProperty($this->request->post, \'fax\'),\n \'password\' => $this->getProperty($this->request->post, \'password\'),\n \'newsletter\' => $this->getProperty($this->request->post, \'newsletter\')\n ));\n\n $customer_id = $this->model_account_customer->addCustomer($data);\n\n // Clear any previous login attempts for unregistered accounts.\n $this->model_account_customer->deleteLoginAttempts($data[\'email\']);\n \n $this->session->data[\'account\'] = \'register\';\n\n $customer_group_info = $this->model_account_customer_group->getCustomerGroup($this->getProperty($this->request->post, \'customer_group_id\', $this->config->get(\'config_customer_group_id\')));\n\n if ($customer_group_info && !$customer_group_info[\'approval\']) {\n $this->customer->login($data[\'email\'], $data[\'password\']);\n\n if ($this->getProperty($this->request->post, \'shipping_address\') != \'1\') {\n $this->model_account_address->addAddress($this->getAddressData($this->request->post, \'shipping_\'));\n }\n\n // Add to activity log\n $activity_data = array(\n \'customer_id\' => $customer_id,\n \'name\' => $data[\'firstname\'] . \' \' . $data[\'lastname\']\n );\n\n $this->model_account_activity->addActivity(\'register\', $activity_data);\n }\n else {\n $redirect = $this->url->link(\'account/success\');\n }\n\n return $redirect;\n }\n\n public function login() {\n $json = array();\n\n if ($this->customer->isLogged()) {\n $json[\'redirect\'] = $this->url->link(\'checkout/checkout\', \'\', true);\n }\n\n if ((!$this->cart->hasProducts() && empty($this->session->data[\'vouchers\'])) || (!$this->cart->hasStock() && !$this->config->get(\'config_stock_checkout\'))) {\n $json[\'redirect\'] = $this->url->link(\'checkout/cart\', \'\', true);\n }\n\n if (!$json) {\n $this->load->model(\'account/customer\');\n\n // Check how many login attempts have been made.\n $login_info = $this->model_account_customer->getLoginAttempts($this->request->post[\'email\']);\n\n if ($login_info && ($login_info[\'total\'] >= $this->config->get(\'config_login_attempts\')) && strtotime(\'-1 hour\') < strtotime($login_info[\'date_modified\'])) {\n $json[\'error\'][\'warning\'] = $this->language->get(\'error_attempts\');\n }\n\n // Check if customer has been approved.\n $customer_info = $this->model_account_customer->getCustomerByEmail($this->request->post[\'email\']);\n\n if ($customer_info && !$customer_info[\'approved\']) {\n $json[\'error\'][\'warning\'] = $this->language->get(\'error_approved\');\n }\n\n if (!isset($json[\'error\'])) {\n if (!$this->customer->login($this->request->post[\'email\'], $this->request->post[\'password\'])) {\n $json[\'error\'][\'warning\'] = $this->language->get(\'error_login\');\n\n $this->model_account_customer->addLoginAttempt($this->request->post[\'email\']);\n } else {\n $this->model_account_customer->deleteLoginAttempts($this->request->post[\'email\']);\n }\n }\n }\n\n if (!$json) {\n unset($this->session->data[\'guest\']);\n\n $this->load->model(\'account/address\');\n\n $address_info = $this->model_account_address->getAddress($this->customer->getAddressId());\n\n if ($this->config->get(\'config_tax_customer\') == \'payment\') {\n $this->session->data[\'payment_address\'] = $address_info;\n }\n\n if ($this->config->get(\'config_tax_customer\') == \'shipping\') {\n $this->session->data[\'shipping_address\'] = $address_info;\n }\n\n $this->model_extension_module_so_onepagecheckout->setAddress(\'shipping\', $address_info);\n $this->model_extension_module_so_onepagecheckout->setAddress(\'payment\', $address_info);\n $this->model_extension_module_so_onepagecheckout->save();\n\n $json[\'redirect\'] = $this->url->link(\'checkout/checkout\', \'\', true);\n\n // Add to activity log\n $this->load->model(\'account/activity\');\n\n $activity_data = array(\n \'customer_id\' => $this->customer->getId(),\n \'name\' => $this->customer->getFirstName() . \' \' . $this->customer->getLastName()\n );\n\n $this->model_account_activity->addActivity(\'login\', $activity_data);\n }\n \n $this->response->addHeader(\'Content-Type: application/json\');\n $this->response->setOutput(json_encode($json));\n }\n ]]></add>\n </operation>\n \n <operation error=\"log\">\n <search ><![CDATA[$data[\'breadcrumbs\'] = array();]]></search>\n <add position=\"before\"><![CDATA[\n $this->load->model(\'setting/setting\');\n $setting_so_onepagecheckout = $this->model_setting_setting->getSetting(\'so_onepagecheckout\');\n if (isset($setting_so_onepagecheckout) && count($setting_so_onepagecheckout)>0) {\n $setting_so_onepagecheckout_general = $setting_so_onepagecheckout[\'so_onepagecheckout_general\']; \n if (isset($setting_so_onepagecheckout_general[\'so_onepagecheckout_enabled\']) && $setting_so_onepagecheckout_general[\'so_onepagecheckout_enabled\']) {\n $this->document->addStyle(\'catalog/view/javascript/so_onepagecheckout/css/so_onepagecheckout.css\');\n $this->document->addScript(\'catalog/view/javascript/so_onepagecheckout/js/so_onepagecheckout.js\');\n $this->load->model(\'localisation/country\');\n $data[\'countries\'] = $this->model_localisation_country->getCountries();\n }\n }\n ]]></add>\n </operation>\n \n <operation error=\"log\">\n <search ><![CDATA[$this->response->setOutput($this->load->view(\'checkout/checkout\', $data));]]></search>\n <add position=\"before\"><![CDATA[\n $this->load->model(\'setting/setting\');\n $setting_so_onepagecheckout = $this->model_setting_setting->getSetting(\'so_onepagecheckout\');\n if (isset($setting_so_onepagecheckout) && count($setting_so_onepagecheckout)>0) {\n $setting_so_onepagecheckout_general = $setting_so_onepagecheckout[\'so_onepagecheckout_general\'];\n $setting_so_onepagecheckout_layout_setting = $setting_so_onepagecheckout[\'so_onepagecheckout_layout_setting\'];\n\n if (isset($setting_so_onepagecheckout_general[\'so_onepagecheckout_enabled\']) && $setting_so_onepagecheckout_general[\'so_onepagecheckout_enabled\']) {\n if (isset($setting_so_onepagecheckout_layout_setting[\'so_onepagecheckout_account_open\']) && !empty($setting_so_onepagecheckout_layout_setting[\'so_onepagecheckout_account_open\'])) {\n $data[\'default_auth\'] = $setting_so_onepagecheckout_layout_setting[\'so_onepagecheckout_account_open\'];\n }\n else {\n $data[\'default_auth\'] = $this->getProperty($this->session->data, \'so_checkout_account\', \'register\');\n }\n\n $data[\'setting_so_onepagecheckout\'] = $setting_so_onepagecheckout;\n $data[\'setting_so_onepagecheckout_general\'] = $setting_so_onepagecheckout_general;\n $data[\'setting_so_onepagecheckout_layout_setting\'] = $setting_so_onepagecheckout_layout_setting;\n \n $data[\'text_register\'] = $this->language->get(\'text_register\');\n $data[\'text_guest\'] = $this->language->get(\'text_guest\');\n $data[\'entry_email\'] = $this->language->get(\'entry_email\');\n $data[\'entry_password\'] = $this->language->get(\'entry_password\');\n $data[\'text_forgotten\'] = $this->language->get(\'text_forgotten\');\n $data[\'text_loading\'] = $this->language->get(\'text_loading\');\n $data[\'button_login\'] = $this->language->get(\'button_login\');\n $data[\'text_i_am_returning_customer\'] = $this->language->get(\'text_i_am_returning_customer\');\n $data[\'text_returning_customer\'] = $this->language->get(\'text_returning_customer\');\n $data[\'text_checkout_create_account_login\'] = $this->language->get(\'text_checkout_create_account_login\');\n\n $data[\'text_your_details\'] = $this->language->get(\'text_your_details\');\n $data[\'entry_customer_group\'] = $this->language->get(\'entry_customer_group\');\n $data[\'entry_firstname\'] = $this->language->get(\'entry_firstname\');\n $data[\'entry_lastname\'] = $this->language->get(\'entry_lastname\');\n $data[\'entry_telephone\'] = $this->language->get(\'entry_telephone\');\n $data[\'entry_fax\'] = $this->language->get(\'entry_fax\');\n $data[\'text_your_password\'] = $this->language->get(\'text_your_password\');\n $data[\'entry_confirm\'] = $this->language->get(\'entry_confirm\');\n $data[\'text_your_address\'] = $this->language->get(\'text_your_address\');\n $data[\'entry_shipping\'] = $this->language->get(\'entry_shipping\');\n $data[\'text_confirm_order\'] = $this->language->get(\'text_confirm_order\');\n\n // address data\n if ($this->isLoggedIn()) {\n $data[\'is_logged_in\'] = true;\n $data[\'payment_address\'] = $this->renderAddressForm(\'payment\');\n $data[\'shipping_address\'] = $this->renderAddressForm(\'shipping\');\n $data[\'register_form\'] = \'\';\n } else {\n $data[\'is_logged_in\'] = false;\n $data[\'allow_guest_checkout\'] = $this->allowGuestCheckout();\n $data[\'register_form\'] = $this->renderRegisterForm();\n }\n\n // shipping\n if ($this->isShippingRequired() && $setting_so_onepagecheckout_layout_setting[\'delivery_method_status\']) {\n $data[\'is_shipping_required\'] = true;\n $data[\'shipping_methods\'] = $this->shipping(true);\n } else {\n $data[\'is_shipping_required\'] = false;\n }\n\n // payment\n $data[\'payment_methods\'] = $this->payment(true);\n\n // coupon + voucher\n $data[\'coupon_voucher_reward\'] = $this->renderCouponVoucherReward();\n\n // cart\n if (isset($setting_so_onepagecheckout_layout_setting[\'shopping_cart_status\']) && $setting_so_onepagecheckout_layout_setting[\'shopping_cart_status\']) {\n $data[\'cart\'] = $this->cart(true);\n }\n else {\n $data[\'cart\'] = \'\';\n }\n\n // checkboxes\n if (!$this->isLoggedIn() && $this->config->get(\'config_account_id\')) {\n $this->load->model(\'catalog/information\');\n\n $information_info = $this->model_catalog_information->getInformation($this->config->get(\'config_account_id\'));\n\n if ($information_info) {\n $data[\'text_privacy\'] = sprintf($this->language->get(\'text_agree\'), $this->url->link(\'information/information/agree\', \'information_id=\' . $this->config->get(\'config_account_id\'), true), $information_info[\'title\'], $information_info[\'title\']);\n } else {\n $data[\'text_privacy\'] = \'\';\n }\n } else {\n $data[\'text_privacy\'] = \'\';\n }\n\n if ($this->config->get(\'config_checkout_id\')) {\n $this->load->model(\'catalog/information\');\n\n $information_info = $this->model_catalog_information->getInformation($this->config->get(\'config_checkout_id\'));\n\n if ($information_info) {\n $data[\'text_agree\'] = sprintf($this->language->get(\'text_agree\'), $this->url->link(\'information/information/agree\', \'information_id=\' . $this->config->get(\'config_checkout_id\'), true), $information_info[\'title\'], $information_info[\'title\']);\n } else {\n $data[\'text_agree\'] = \'\';\n }\n } else {\n $data[\'text_agree\'] = \'\';\n }\n\n if ($data[\'text_privacy\'] === $data[\'text_agree\']) {\n $data[\'text_privacy\'] = \'\';\n }\n\n $data[\'text_comments\'] = $this->language->get(\'text_comments\');\n\n if ($this->isLoggedIn()) {\n $data[\'entry_newsletter\'] = false;\n } else {\n $data[\'entry_newsletter\'] = sprintf($this->language->get(\'entry_newsletter\'), $this->config->get(\'config_name\'));\n }\n\n $data[\'comment\'] = $this->model_extension_module_so_onepagecheckout->getComment();\n\n if (isset($this->session->data[\'error\'])) {\n $data[\'error_warning\'] = $this->session->data[\'error\'];\n unset($this->session->data[\'error\']);\n } else {\n $data[\'error_warning\'] = \'\';\n }\n\n $data[\'customer_groups\'] = array();\n if (is_array($this->config->get(\'config_customer_group_display\'))) {\n $this->load->model(\'account/customer_group\');\n \n $customer_groups = $this->model_account_customer_group->getCustomerGroups();\n \n foreach ($customer_groups as $customer_group) {\n if (in_array($customer_group[\'customer_group_id\'], $this->config->get(\'config_customer_group_display\'))) {\n $data[\'customer_groups\'][] = $customer_group;\n }\n }\n }\n if (isset($this->request->post[\'customer_group_id\'])) {\n $data[\'customer_group_id\'] = $this->request->post[\'customer_group_id\'];\n } else {\n $data[\'customer_group_id\'] = $this->config->get(\'config_customer_group_id\');\n }\n \n \n \n //Get cart\n $this->load->model(\'tool/image\');\n $this->load->model(\'tool/upload\');\n \n $data[\'products\'] = array();\n $products = $this->cart->getProducts();\n foreach ($products as $product) {\n $product_total = 0;\n \n foreach ($products as $product_2) {\n if ($product_2[\'product_id\'] == $product[\'product_id\']) {\n $product_total += $product_2[\'quantity\'];\n }\n }\n \n if ($product[\'minimum\'] > $product_total) {\n $data[\'error_warning\'] = sprintf($this->language->get(\'error_minimum\'), $product[\'name\'], $product[\'minimum\']);\n }\n \n if ($product[\'image\']) {\n $image = $this->model_tool_image->resize($product[\'image\'], $this->config->get($this->config->get(\'config_theme\') . \'_image_cart_width\'), $this->config->get($this->config->get(\'config_theme\') . \'_image_cart_height\'));\n } else {\n $image = \'\';\n }\n \n $option_data = array();\n \n foreach ($product[\'option\'] as $option) {\n if ($option[\'type\'] != \'file\') {\n $value = $option[\'value\'];\n } else {\n $upload_info = $this->model_tool_upload->getUploadByCode($option[\'value\']);\n \n if ($upload_info) {\n $value = $upload_info[\'name\'];\n } else {\n $value = \'\';\n }\n }\n \n $option_data[] = array(\n \'name\' => $option[\'name\'],\n \'value\' => (utf8_strlen($value) > 20 ? utf8_substr($value, 0, 20) . \'..\' : $value)\n );\n }\n \n // Display prices\n if ($this->customer->isLogged() || !$this->config->get(\'config_customer_price\')) {\n $unit_price = $this->tax->calculate($product[\'price\'], $product[\'tax_class_id\'], $this->config->get(\'config_tax\'));\n \n $price = $this->currency->format($unit_price, $this->session->data[\'currency\']);\n $total = $this->currency->format($unit_price * $product[\'quantity\'], $this->session->data[\'currency\']);\n } else {\n $price = false;\n $total = false;\n }\n \n $recurring = \'\';\n \n if ($product[\'recurring\']) {\n $frequencies = array(\n \'day\' => $this->language->get(\'text_day\'),\n \'week\' => $this->language->get(\'text_week\'),\n \'semi_month\' => $this->language->get(\'text_semi_month\'),\n \'month\' => $this->language->get(\'text_month\'),\n \'year\' => $this->language->get(\'text_year\'),\n );\n \n if ($product[\'recurring\'][\'trial\']) {\n $recurring = sprintf($this->language->get(\'text_trial_description\'), $this->currency->format($this->tax->calculate($product[\'recurring\'][\'trial_price\'] * $product[\'quantity\'], $product[\'tax_class_id\'], $this->config->get(\'config_tax\')), $this->session->data[\'currency\']), $product[\'recurring\'][\'trial_cycle\'], $frequencies[$product[\'recurring\'][\'trial_frequency\']], $product[\'recurring\'][\'trial_duration\']) . \' \';\n }\n \n if ($product[\'recurring\'][\'duration\']) {\n $recurring .= sprintf($this->language->get(\'text_payment_description\'), $this->currency->format($this->tax->calculate($product[\'recurring\'][\'price\'] * $product[\'quantity\'], $product[\'tax_class_id\'], $this->config->get(\'config_tax\')), $this->session->data[\'currency\']), $product[\'recurring\'][\'cycle\'], $frequencies[$product[\'recurring\'][\'frequency\']], $product[\'recurring\'][\'duration\']);\n } else {\n $recurring .= sprintf($this->language->get(\'text_payment_cancel\'), $this->currency->format($this->tax->calculate($product[\'recurring\'][\'price\'] * $product[\'quantity\'], $product[\'tax_class_id\'], $this->config->get(\'config_tax\')), $this->session->data[\'currency\']), $product[\'recurring\'][\'cycle\'], $frequencies[$product[\'recurring\'][\'frequency\']], $product[\'recurring\'][\'duration\']);\n }\n }\n \n $data[\'products\'][] = array(\n \'cart_id\' => $product[\'cart_id\'],\n \'thumb\' => $image,\n \'name\' => $product[\'name\'],\n \'model\' => $product[\'model\'],\n \'option\' => $option_data,\n \'recurring\' => $recurring,\n \'quantity\' => $product[\'quantity\'],\n \'stock\' => $product[\'stock\'] ? true : !(!$this->config->get(\'config_stock_checkout\') || $this->config->get(\'config_stock_warning\')),\n \'reward\' => ($product[\'reward\'] ? sprintf($this->language->get(\'text_points\'), $product[\'reward\']) : \'\'),\n \'price\' => $price,\n \'total\' => $total,\n \'href\' => $this->url->link(\'product/product\', \'product_id=\' . $product[\'product_id\'])\n );\n }\n \n // Gift Voucher\n $data[\'vouchers\'] = array();\n \n if (!empty($this->session->data[\'vouchers\'])) {\n foreach ($this->session->data[\'vouchers\'] as $key => $voucher) {\n $data[\'vouchers\'][] = array(\n \'key\' => $key,\n \'description\' => $voucher[\'description\'],\n \'amount\' => $this->currency->format($voucher[\'amount\'], $this->session->data[\'currency\']),\n \'remove\' => $this->url->link(\'checkout/cart\', \'remove=\' . $key)\n );\n }\n }\n \n // Totals\n $this->load->model(\'extension/extension\');\n \n $totals = array();\n $taxes = $this->cart->getTaxes();\n $total = 0;\n \n // Because __call can not keep var references so we put them into an array. \n $total_data = array(\n \'totals\' => &$totals,\n \'taxes\' => &$taxes,\n \'total\' => &$total\n );\n \n // Display prices\n if ($this->customer->isLogged() || !$this->config->get(\'config_customer_price\')) {\n $sort_order = array();\n \n $results = $this->model_extension_extension->getExtensions(\'total\');\n \n foreach ($results as $key => $value) {\n $sort_order[$key] = $this->config->get($value[\'code\'] . \'_sort_order\');\n }\n \n array_multisort($sort_order, SORT_ASC, $results);\n \n foreach ($results as $result) {\n if ($this->config->get($result[\'code\'] . \'_status\')) {\n $this->load->model(\'extension/total/\' . $result[\'code\']);\n \n // We have to put the totals in an array so that they pass by reference.\n $this->{\'model_extension_total_\' . $result[\'code\']}->getTotal($total_data);\n }\n }\n \n $sort_order = array();\n \n foreach ($totals as $key => $value) {\n $sort_order[$key] = $value[\'sort_order\'];\n }\n \n array_multisort($sort_order, SORT_ASC, $totals);\n }\n \n $data[\'totals\'] = array();\n \n foreach ($totals as $total) {\n $data[\'totals\'][] = array(\n \'title\' => $total[\'title\'],\n \'text\' => $this->currency->format($total[\'value\'], $this->session->data[\'currency\'])\n );\n }\n }\n }\n ]]></add>\n </operation>\n \n <operation error=\"log\">\n <search ><![CDATA[$this->response->setOutput($this->load->view(\'checkout/checkout\', $data));]]></search>\n <add position=\"replace\"><![CDATA[\n if (isset($setting_so_onepagecheckout_general[\'so_onepagecheckout_enabled\']) && $setting_so_onepagecheckout_general[\'so_onepagecheckout_enabled\']) {\n $data[\'forgotten\'] = $this->url->link(\'account/forgotten\', \'\', true);\n $this->model_extension_module_so_onepagecheckout->save();\n if ($setting_so_onepagecheckout_general[\'so_onepagecheckout_layout\'] == 1)\n $this->response->setOutput($this->load->view(\'extension/module/so_onepagecheckout/default\', $data));\n else if ($setting_so_onepagecheckout_general[\'so_onepagecheckout_layout\'] == 2)\n $this->response->setOutput($this->load->view(\'extension/module/so_onepagecheckout/default2\', $data));\n }\n else {\n $this->response->setOutput($this->load->view(\'checkout/checkout\', $data));\n }\n ]]></add>\n </operation>\n </file>\n</modification>\n', 1, '2017-04-24 14:00:14');
INSERT INTO `zmall_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
(13, 'So Countdown Popup', 'So-countdown-popup', 'OpencartWorks', '1.0.0', 'http://www.opencartworks.com/', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n <name>So Countdown Popup</name>\n <code>So-countdown-popup</code>\n <version>1.0.0</version>\n <author>OpencartWorks</author>\n <link>http://www.opencartworks.com/</link>\n \n <file path=\"catalog/controller/common/footer.php\">\n <operation error=\"log\">\n <search ><![CDATA[return $this->load->view(\'common/footer\', $data);]]></search>\n <add position=\"before\"><![CDATA[\n $data[\'so_countdown\'] = $this->load->controller(\'extension/module/so_countdown\');\n ]]></add>\n </operation>\n </file>\n \n <file path=\"catalog/view/theme/*/template/common/footer.tpl\">\n <operation error=\"log\">\n <search ><![CDATA[<div id=\"popup-countdown\"></div>]]></search>\n <add position=\"after\"><![CDATA[\n <?php echo $so_countdown?>\n ]]></add>\n </operation>\n </file>\n</modification>', 1, '2017-06-20 16:36:06'),
(14, 'So Tools', 'So-Tools', 'OpencartWorks', '1.0.0', 'http://www.opencartworks.com/', '<?xml version=\"1.0\" encoding=\"utf-8\"?> \n<modification> \n <name>So Tools</name> \n <code>So-Tools</code> \n <version>1.0.0</version> \n <author>OpencartWorks</author> \n <link>http://www.opencartworks.com/</link> \n \n <file path=\"catalog/controller/common/footer.php\"> \n <operation error=\"log\"> \n <search ><![CDATA[return $this->load->view(\'common/footer\', $data);]]></search> \n <add position=\"before\"><![CDATA[ \n //$data[\'so_tools\'] = $this->load->controller(\'extension/module/so_tools\'); \n ]]></add> \n </operation> \n </file> \n \n <file path=\"catalog/view/theme/*/template/common/footer.tpl\"> \n <operation error=\"log\"> \n <search ><![CDATA[</footer>]]></search> \n <add position=\"after\"><![CDATA[ \n <?php //echo $so_tools?> \n ]]></add> \n </operation> \n </file> \n \n <file path=\"catalog/controller/product/product.php\"> \n <operation> \n <search><![CDATA[$this->load->model(\'catalog/manufacturer\');]]></search> \n <add position=\"after\"><![CDATA[ \n $so_recent_products = array(); \n if (isset($this->request->cookie[\'sorecentproduct\'])) { \n $so_recent_products = explode(\',\', $this->request->cookie[\'sorecentproduct\']); \n } else if (isset($this->session->data[\'sorecentproduct\'])) { \n $so_recent_products = $this->session->data[\'sorecentproduct\']; \n } \n \n if (isset($this->request->get[\'route\']) && $this->request->get[\'route\'] == \'product/product\') { \n $product_id = $this->request->get[\'product_id\']; \n $so_recent_products = array_diff($so_recent_products, array($product_id)); \n array_unshift($so_recent_products, $product_id); \n setcookie(\'sorecentproduct\', implode(\',\', $so_recent_products), time() + 60 * 60 * 24 * 30, \'/\', $this->request->server[\'HTTP_HOST\']); \n if (!isset($this->session->data[\'sorecentproduct\']) || $this->session->data[\'sorecentproduct\'] != $so_recent_products) { \n $this->session->data[\'sorecentproduct\'] = $so_recent_products; \n } \n } \n ]]></add> \n </operation> \n </file> \n</modification>', 1, '2017-06-21 09:14:07'),
(6, 'OCMod Editor', 'ocmod-editor', 'OpenCart Brasil', '1.6', 'http://www.opencartbrasil.com.br', '<?xml version=\"1.0\" encoding=\"utf-8\"?> \n<modification> \n <name>OCMod Editor</name> \n <code>ocmod-editor</code> \n <version>1.6</version> \n <author>OpenCart Brasil</author> \n <link>http://www.opencartbrasil.com.br</link> \n <file path=\"admin/controller/extension/modification.php\"> \n <operation> \n <search> \n <![CDATA[$data[\'refresh\'] = $this->url->link(\'extension/modification/refresh\', \'token=\' . $this->session->data[\'token\'] . $url, true);]]> \n </search> \n <add position=\"before\"> \n <![CDATA[$data[\'new\'] = $this->url->link(\'extension/modification_editor\', \'token=\' . $this->session->data[\'token\'] . $url, true);]]> \n </add> \n </operation> \n <operation> \n <search> \n <![CDATA[$data[\'modifications\'][] = array(]]> \n </search> \n <add position=\"after\"> \n <![CDATA[ \n \'edit\' => $this->url->link(\'extension/modification_editor\', \'token=\' . $this->session->data[\'token\'] . \'&modification_id=\' . $result[\'modification_id\'], true), \n \'download\' => $this->url->link(\'extension/modification_editor/download\', \'token=\' . $this->session->data[\'token\'] . \'&modification_id=\' . $result[\'modification_id\'], true), \n ]]> \n </add> \n </operation> \n <operation> \n <search> \n <![CDATA[$data[\'tab_log\'] = $this->language->get(\'tab_log\');]]> \n </search> \n <add position=\"after\"> \n <![CDATA[ \n $this->load->language(\'extension/modification_editor\'); \n $data[\'button_new\'] = $this->language->get(\'button_new\'); \n $data[\'button_edit\'] = $this->language->get(\'button_edit\'); \n $data[\'button_download\'] = $this->language->get(\'button_download\'); \n ]]> \n </add> \n </operation> \n <operation> \n <search index=\"1\"> \n <![CDATA[$this->response->redirect($this->url->link(\'extension/modification\', \'token=\' . $this->session->data[\'token\'] . $url, true));]]> \n </search> \n <add position=\"replace\"> \n <![CDATA[ \n if (isset($this->request->get[\'modification_editor\'])) { \n echo $this->session->data[\'success\']; \n exit; \n } else { \n $this->response->redirect($this->url->link(\'extension/modification\', \'token=\' . $this->session->data[\'token\'] . $url, true)); \n } \n ]]> \n </add> \n </operation> \n </file> \n \n <file path=\"admin/view/template/extension/modification.tpl\"> \n <operation> \n <search> \n <![CDATA[<div class=\"pull-right\">]]> \n </search> \n <add position=\"after\"> \n <![CDATA[<a href=\"<?php echo $new; ?>\" data-toggle=\"tooltip\" title=\"<?php echo $button_new; ?>\" class=\"btn btn-primary\"><i class=\"fa fa-plus\"></i></a>]]> \n </add> \n </operation> \n <operation> \n <search> \n <![CDATA[<?php if (!$modification[\'enabled\']) { ?>]]> \n </search> \n <add position=\"before\"> \n <![CDATA[ \n <a href=\"<?php echo $modification[\'edit\']; ?>\" data-toggle=\"tooltip\" title=\"<?php echo $button_edit; ?>\" class=\"btn btn-primary\"><i class=\"fa fa-pencil\"></i></a> \n <a href=\"<?php echo $modification[\'download\']; ?>\" data-toggle=\"tooltip\" title=\"<?php echo $button_download; ?>\" class=\"btn btn-success\"><i class=\"fa fa-cloud-download\"></i></a> \n ]]> \n </add> \n </operation> \n </file> \n</modification>', 1, '2017-03-09 17:05:06'),
(5, 'Bug Fixing OC-2.3.0.2', 'bug_fixing_2302', 'vanstudio.co.ua', '1.0', 'https://www.opencart.com/index.php?route=marketplace/extension&filter_member=vanstudio', '<?xml version=\"1.0\" encoding=\"UTF-8\"?> \n<modification> \n <code>bug_fixing_2302</code> \n <name>Bug Fixing OC-2.3.0.2</name> \n <version>1.0</version> \n <author>vanstudio.co.ua</author> \n <link>https://www.opencart.com/index.php?route=marketplace/extension&amp;filter_member=vanstudio</link> \n <file path=\"admin/controller/common/filemanager.php\"> \n <operation> \n <search><![CDATA[if (substr(str_replace(\'\\\\\', \'/\', realpath($directory . \'/\' . $filter_name)), 0, strlen(DIR_IMAGE . \'catalog\')) == DIR_IMAGE . \'catalog\') {]]></search> \n <add position=\"replace\"><![CDATA[if (substr(str_replace(\'\\\\\', \'/\', realpath($directory . \'/\')), 0, strlen(DIR_IMAGE . \'catalog\')) == DIR_IMAGE . \'catalog\') {]]></add> \n </operation> \n <operation> \n <search><![CDATA[\'name\' => implode(\' \', $name),]]></search> \n <add position=\"replace\"><![CDATA[\'name\' => implode(\'\', $name),]]></add> \n </operation> \n </file> \n <file path=\"admin/model/localisation/language.php\"> \n <operation> \n <search><![CDATA[$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"banner_image_description WHERE language_id = \'\" . (int)$language_id . \"\'\");]]></search> \n <add position=\"replace\"><![CDATA[$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"banner_image WHERE language_id = \'\" . (int)$language_id . \"\'\");]]></add> \n </operation> \n </file> \n <file path=\"admin/view/template/setting/setting.tpl\"> \n <operation> \n <search><![CDATA[config_mail_alert_email]]></search> \n <add position=\"replace\"><![CDATA[config_alert_email]]></add> \n </operation> \n </file> \n</modification>', 1, '2017-03-09 09:34:41'),
(12, 'So Mobile', 'so-mobile', 'OpenCartWorks', '1.0.0', 'http://www.opencartworks.com/', '<?xml version=\"1.0\" encoding=\"utf-8\"?> \n<modification> \n <name><![CDATA[So Mobile]]></name> \n <code>so-mobile</code> \n <version><![CDATA[1.0.0]]></version> \n <author><![CDATA[OpenCartWorks]]></author> \n <link>http://www.opencartworks.com/</link> \n <!--Catalog/controller/common--> \n <file path=\"catalog/controller/common/home.php\"> \n <operation > \n <search ><![CDATA[public function index()]]></search> \n <add position=\"after\"><![CDATA[$data[\'mobile\'] = $this->config->get(\'mobile_general\'); \n if($this->session->data[\'device\']==\'mobile\' && $data[\'mobile\'][\'platforms_mobile\']){ \n return $this->response->redirect($this->url->link(\'mobile/home\')); \n }else{ \n ]]></add> \n </operation> \n <operation > \n <search ><![CDATA[$this->response->setOutput($this->load->view(\'common/home\', $data));]]></search> \n <add position=\"replace\"><![CDATA[ \n return $this->response->setOutput($this->load->view(\'common/home\', $data)); \n } \n ]]></add> \n </operation> \n </file> \n \n <file path=\"catalog/controller/common/header.php\"> \n <operation > \n <search ><![CDATA[$data[\'language\'] = $this->load->controller(\'common/language\')]]></search> \n <add position=\"before\"><![CDATA[ \n $this->load->language(\'extension/soconfig/mobile\'); \n $data[\'objlang\'] = $this->language; \n $data[\'menu_search\'] = $this->url->link(\'product/search\', \'\', true); \n $data[\'mobile\'] = $this->config->get(\'mobile_general\'); \n $data[\'text_items\'] = sprintf($this->language->get(\'text_itemcount\'), $this->cart->countProducts() + (isset($this->session->data[\'vouchers\']) ? count($this->session->data[\'vouchers\']) : 0)); \n if($this->session->data[\'device\']==\'mobile\'){ \n $data[\'home\'] = $this->url->link(\'mobile/home\'); \n }else{ \n $data[\'home\'] = $this->url->link(\'common/home\'); \n } \n if(isset($this->request->get[\'layoutmobile\'])) $data[\'layoutmobile\'] = $this->request->get[\'layoutmobile\']; \n ]]></add> \n </operation> \n </file> \n \n <file path=\"catalog/controller/common/footer.php\"> \n <operation> \n <search ><![CDATA[return $this->load->view(\'common/footer\', $data); ]]></search> \n <add position=\"before\"><![CDATA[ \n // Menu Mobile \n $this->load->model(\'catalog/category\'); \n $this->load->model(\'catalog/product\'); \n $this->load->language(\'extension/soconfig/mobile\'); \n $data[\'objlang\'] = $this->language; \n $data[\'categories\'] = array(); \n $data[\'mobile\'] = $this->config->get(\'mobile_general\'); \n $data[\'text_account\'] = $this->language->get(\'text_account\'); \n $data[\'text_register\'] = $this->language->get(\'text_register\'); \n $data[\'text_login\'] = $this->language->get(\'text_login\'); \n \n $categories = $this->model_catalog_category->getCategories(0); \n \n \n foreach ($categories as $category) { \n if ($category[\'top\']) { \n // Level 2 \n $children_data = array(); \n \n $children = $this->model_catalog_category->getCategories($category[\'category_id\']); \n \n foreach ($children as $child) { \n $filter_data = array( \n \'filter_category_id\' => $child[\'category_id\'], \n \'filter_sub_category\' => true \n ); \n \n $children_data[] = array( \n \'name\' => $child[\'name\'] . ($this->config->get(\'config_product_count\') ? \' (\' . $this->model_catalog_product->getTotalProducts($filter_data) . \')\' : \'\'), \n \'href\' => $this->url->link(\'product/category\', \'path=\' . $category[\'category_id\'] . \'_\' . $child[\'category_id\']) \n ); \n } \n \n // Level 1 \n $data[\'categories\'][] = array( \n \'name\' => $category[\'name\'], \n \'children\' => $children_data, \n \'column\' => $category[\'column\'] ? $category[\'column\'] : 1, \n \'href\' => $this->url->link(\'product/category\', \'path=\' . $category[\'category_id\']) \n ); \n } \n } \n \n $data[\'language\'] = $this->load->controller(\'common/language\'); \n $data[\'currency\'] = $this->load->controller(\'common/currency\'); \n $data[\'search\'] = $this->load->controller(\'common/search\'); \n $data[\'cart\'] = $this->load->controller(\'common/cart\'); \n $data[\'wishlist\'] = $this->url->link(\'account/wishlist\', \'\', true); \n $data[\'compare\'] = $this->url->link(\'product/compare\', \'\', \'SSL\'); \n $data[\'text_compare\'] = sprintf($this->language->get(\'text_compare\'),(isset($this->session->data[\'compare\']) ? count($this->session->data[\'compare\']) : 0)); \n $data[\'logged\'] = $this->customer->isLogged(); \n $data[\'account\'] = $this->url->link(\'account/account\', \'\', true); \n $data[\'register\'] = $this->url->link(\'account/register\', \'\', true); \n $data[\'login\'] = $this->url->link(\'account/login\', \'\', true); \n \n \n ]]></add> \n </operation> \n \n </file> \n <!--End Catalog/controller/common--> \n \n <!--Catalog/controller/product--> \n <file path=\"catalog/controller/product/category.php\"> \n <operation> \n <search ><![CDATA[$data[\'heading_title\'] = $category_info[\'name\']]]></search> \n <add position=\"before\"><![CDATA[$data[\'mobile\'] = $this->config->get(\'mobile_general\'); \n $this->load->language(\'extension/soconfig/mobile\'); \n $data[\'objlang\'] = $this->language; \n ]]></add> \n </operation> \n </file> \n <file path=\"catalog/controller/product/{search,special,manufacturer}*.php\"> \n <operation> \n <search ><![CDATA[$this->load->model(\'tool/image\')]]></search> \n <add position=\"after\"><![CDATA[$data[\'mobile\'] = $this->config->get(\'mobile_general\');]]></add> \n </operation> \n \n </file> \n <file path=\"catalog/controller/product/product.php\"> \n <operation error=\"skip\"> \n <search ><![CDATA[$this->document->addScript(\'catalog/view/javascript/jquery/datetimepicker/moment.js\');]]></search> \n <add position=\"before\"><![CDATA[ \n if($this->session->data[\'device\']==\'mobile\'){ \n $this->document->addStyle(\'catalog/view/javascript/soconfig/css/mobile/slick.css\'); \n $this->document->addScript(\'catalog/view/javascript/soconfig/js/mobile/slick.min.js\'); \n } \n ]]></add> \n </operation> \n </file> \n <!--End Catalog/controller/product--> \n \n</modification>', 1, '2017-05-24 14:26:33'),
(15, 'So Mobile', 'so_mobile', 'OpenCartWorks', '1.0.0', 'http://www.opencartworks.com/', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n	<name><![CDATA[So Mobile]]></name>\r\n	<code>so-mobile</code>\r\n    <version><![CDATA[1.0.0]]></version>\r\n    <author><![CDATA[OpenCartWorks]]></author>\r\n	<link>http://www.opencartworks.com/</link>\r\n	<!--Catalog/controller/common-->\r\n	<file path=\"catalog/controller/common/home.php\">\r\n		<operation  >\r\n			<search ><![CDATA[$data[\'header\'] = $this->load->controller(\'common/header\');]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n				$data[\'mobile\'] = $this->config->get(\'mobile_general\');\r\n		]]></add>\r\n		</operation>\r\n		<operation  >\r\n	<search ><![CDATA[$this->response->setOutput($this->load->view(\'common/home\', $data));]]></search>\r\n	    <add position=\"replace\"><![CDATA[\r\n		     if($this->session->data[\'device\']==\'mobile\' && $data[\'mobile\'][\'platforms_mobile\'])$this->response->redirect($this->url->link(\'mobile/home\'));\r\n		    else $this->response->setOutput($this->load->view(\'common/home\', $data));\r\n        ]]></add>\r\n   </operation>\r\n	</file>\r\n	\r\n	<file path=\"catalog/controller/common/header.php\">\r\n		<operation  >\r\n			<search ><![CDATA[$data[\'language\'] = $this->load->controller(\'common/language\')]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n				$this->load->language(\'extension/soconfig/mobile\');\r\n				$data[\'objlang\'] = $this->language;\r\n				$data[\'menu_search\'] = $this->url->link(\'product/search\', \'\', true);\r\n				$data[\'mobile\'] = $this->config->get(\'mobile_general\');\r\n				$data[\'text_items\'] = sprintf($this->language->get(\'text_itemcount\'), $this->cart->countProducts() + (isset($this->session->data[\'vouchers\']) ? count($this->session->data[\'vouchers\']) : 0));\r\n				if($this->session->data[\'device\']==\'mobile\'){\r\n					$data[\'home\'] = $this->url->link(\'mobile/home\');\r\n				}else{\r\n					$data[\'home\'] = $this->url->link(\'common/home\');\r\n				}\r\n				if(isset($this->request->get[\'layoutmobile\'])) $data[\'layoutmobile\'] = $this->request->get[\'layoutmobile\'];\r\n		]]></add>\r\n		</operation>\r\n	</file>\r\n	\r\n	<file path=\"catalog/controller/common/footer.php\">\r\n		<operation>\r\n			<search ><![CDATA[return $this->load->view(\'common/footer\', $data); ]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n				// Menu Mobile\r\n				$this->load->model(\'catalog/category\');\r\n				$this->load->model(\'catalog/product\');\r\n				$this->load->language(\'extension/soconfig/mobile\');\r\n				$data[\'objlang\'] = $this->language;\r\n				$data[\'categories\'] = array();\r\n				$data[\'mobile\'] = $this->config->get(\'mobile_general\');\r\n				$data[\'text_account\'] = $this->language->get(\'text_account\');\r\n				$data[\'text_register\'] = $this->language->get(\'text_register\');\r\n				$data[\'text_login\'] = $this->language->get(\'text_login\');\r\n				\r\n				$categories = $this->model_catalog_category->getCategories(0);\r\n				\r\n				\r\n				foreach ($categories as $category) {\r\n					if ($category[\'top\']) {\r\n						// Level 2\r\n						$children_data = array();\r\n\r\n						$children = $this->model_catalog_category->getCategories($category[\'category_id\']);\r\n\r\n						foreach ($children as $child) {\r\n							$filter_data = array(\r\n								\'filter_category_id\'  => $child[\'category_id\'],\r\n								\'filter_sub_category\' => true\r\n							);\r\n\r\n							$children_data[] = array(\r\n								\'name\'  => $child[\'name\'] . ($this->config->get(\'config_product_count\') ? \' (\' . $this->model_catalog_product->getTotalProducts($filter_data) . \')\' : \'\'),\r\n								\'href\'  => $this->url->link(\'product/category\', \'path=\' . $category[\'category_id\'] . \'_\' . $child[\'category_id\'])\r\n							);\r\n						}\r\n\r\n						// Level 1\r\n						$data[\'categories\'][] = array(\r\n							\'name\'     => $category[\'name\'],\r\n							\'children\' => $children_data,\r\n							\'column\'   => $category[\'column\'] ? $category[\'column\'] : 1,\r\n							\'href\'     => $this->url->link(\'product/category\', \'path=\' . $category[\'category_id\'])\r\n						);\r\n					}\r\n				}\r\n\r\n				$data[\'language\'] = $this->load->controller(\'common/language\');\r\n				$data[\'currency\'] = $this->load->controller(\'common/currency\');\r\n				$data[\'search\'] = $this->load->controller(\'common/search\');\r\n				$data[\'cart\'] = $this->load->controller(\'common/cart\');\r\n				$data[\'wishlist\'] = $this->url->link(\'account/wishlist\', \'\', true);\r\n				$data[\'compare\'] = $this->url->link(\'product/compare\', \'\', \'SSL\');\r\n				$data[\'text_compare\']  = sprintf($this->language->get(\'text_compare\'),(isset($this->session->data[\'compare\']) ? count($this->session->data[\'compare\']) : 0));\r\n				$data[\'logged\'] = $this->customer->isLogged();\r\n				$data[\'account\'] = $this->url->link(\'account/account\', \'\', true);\r\n				$data[\'register\'] = $this->url->link(\'account/register\', \'\', true);\r\n				$data[\'login\'] = $this->url->link(\'account/login\', \'\', true);\r\n				\r\n			\r\n			]]></add>\r\n		</operation>\r\n		\r\n	</file>\r\n	<!--End Catalog/controller/common-->\r\n	\r\n	<!--Catalog/controller/product-->\r\n	<file path=\"catalog/controller/product/category.php\">\r\n		<operation>\r\n			<search ><![CDATA[$data[\'heading_title\'] = $category_info[\'name\']]]></search>\r\n			<add position=\"before\"><![CDATA[$data[\'mobile\'] = $this->config->get(\'mobile_general\');]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path=\"catalog/controller/product/{search,special,manufacturer}*.php\">\r\n		<operation>\r\n			<search ><![CDATA[$this->load->model(\'tool/image\')]]></search>\r\n			<add position=\"after\"><![CDATA[$data[\'mobile\'] = $this->config->get(\'mobile_general\');]]></add>\r\n		</operation> \r\n      \r\n    </file>\r\n	<file path=\"catalog/controller/product/product.php\">\r\n		<operation error=\"skip\">\r\n			<search ><![CDATA[$this->document->addScript(\'catalog/view/javascript/jquery/datetimepicker/moment.js\');]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n			if($this->session->data[\'device\']==\'mobile\'){\r\n				$this->document->addStyle(\'catalog/view/javascript/soconfig/css/mobile/slick.css\');\r\n				$this->document->addScript(\'catalog/view/javascript/soconfig/js/mobile/slick.min.js\');\r\n			}\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<!--End Catalog/controller/product-->\r\n	<file path=\"catalog/controller/extension/module/so_filter_shop_by.php\">\r\n       <operation>\r\n            <search><![CDATA[$footer 			= \'\';]]></search>\r\n            <add position=\"after\"><![CDATA[$mobile = $this->config->get(\'mobile_general\');\r\n			$objlang = $this->language;\r\n            ]]></add>\r\n        </operation>\r\n	</file>\r\n</modification>', 1, '2017-02-16 17:27:40');
